  \"2013-03-15T23:16:50.396565\",\n\t\"name\": \"iowa-well-headers\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This dataset is a compilation of observations
  compiled by the Iowa Geological and Water Survey, published as a web feature service,
  a web map service, an ESRI service and as an Excel spreadsheet for the National
  Geothermal Data System. The downloadable document contains 8 worksheets, including
  information about the template, notes related to revisions of the template, Resource
  provider information, the data, a field list (data mapping view) and a worksheet
  with vocabularies for use in populating the spreadsheet (data valid terms). Data
  from 64047 wells are included. Fields in the data table include HeaderURI, WellName
  , APINo, OtherID, OtherName, BoreholeName, ParentWellURI, Operator, MineralOwner,
  Driller, LeaseName, SpudDate, EndedDrillingDate, DrillingMethod, WellType, Status,
  CommodityOfInterest, StatusDate, Function, Production , ProducingInterval , \",\n\t\"license_title\":
